import styles from "../assets/ContactInformation.module.css";

function ContactInformation() {
  return (
    <div className={styles.contactInfo}>
      <div className={styles.infoContainer}>
        <h1>Contacte</h1>
      </div>
    </div>
  );
}

export default ContactInformation;
